import React from 'react'
import Definition from './Definition'
import DescriptionData from './DescriptionData'

const ProjectDescription = () => {
    const Description = [{
        TMfixedCost : "12,0000"

    },
    {
        Title: "No.of.resources used",
        Calculation: 24

    },
    {
        Title: "Weekly% Completion",
        Calculation: "13%"

    },
    {
        Title: "No.of Features/Stories",
        Calculation: 24

    },
    {
        Title: "Features Completed",
        Calculation: "13%"

    },
    {
        Title: "New Bugs",
        Calculation: "28%"

    },
    {
        Title: "Bugs Fixed",
        Calculation: 25

    },
    {
        Title: "Code Review",
        Calculation: 24

    },
    {
        Title: "Unit Testing",
        Calculation: "13%"

    },
    {
        Title: "Weekly Communication",
        Calculation: "28%"

    }]
    const Details = [{
        Head: "Dependencies",
        Definition: "Lorem Ipsum is simply dummy text of the printing and typesetting industry "

    },
    {
        Head: "Risks",
        Definition: "Lorem Ipsum is simply dummy text of the printing and typesetting industry "
    },
    {
        Head: "Risks Mitigation",
        Definition: "Lorem Ipsum is simply dummy text of the printing and typesetting industry."
    },
    {
        Head: "Support Required",
        Definition: "Lorem Ipsum is simply dummy text of the printing and typesetting industry."
    }]
    return (

        <div className='ProjectDescription-All'>
            <div className='ProjectDescription_Data' >
                {Description && Description.map((data) =>
                    <DescriptionData data={data} />)}



            </div>
            <div>
                <div className='ProjectDescription_Definition'>
                    {Details && Details.map((value) =>

                        <Definition value={value} />)}
                </div>
            </div>
        </div>


    )
}
export default ProjectDescription;
